import React from 'react';
import { SidebarItem } from './SidebarItem';
import styles from './Dashboard.module.css';

const sidebarItems = [
  { icon: "/icons/dashboard.svg", label: "Dashboard", isActive: true },
  { icon: "/icons/frontdesk.svg", label: "Front desk" },
  { icon: "/icons/guest.svg", label: "Guest" },
  { icon: "/icons/rooms.svg", label: "Rooms" },
  { icon: "/icons/deal.svg", label: "Deal" },
  { icon: "/icons/rate.svg", label: "Rate" }
];

export const Sidebar = () => {
  return (
    <div className={styles.sidebar}>
      <div className={styles.logo}>
        <img src="/logo.svg" alt="Novotel Logo" className={styles.logoImage} />
        <span className={styles.logoText}>Novotel</span>
      </div>
      <nav className={styles.navigation}>
        {sidebarItems.map((item, index) => (
          <SidebarItem
            key={index}
            icon={item.icon}
            label={item.label}
            isActive={item.isActive}
          />
        ))}
      </nav>
    </div>
  );
};
